import React from "react";
import {
  Box,
  Grid,
  Text,
  Flex,
  Accordion,
  Center,
  Avatar,
  Badge,
  Checkbox,
  Button,
  ColorPicker,
  Input,
  Stack,
  Image,
  Card,
  Slider,
  ActionIcon,
} from "@mantine/core";
import {
  IconPlus,
  IconX,
  IconColumns1,
  IconBold,
  IconUnderline,
  IconItalic,
  IconLetterN,
} from "@tabler/icons-react";

const HomeSlider = () => {
  return (
    <Accordion.Item value="slider">
    <Accordion.Control bg="indigo.2">
      <Center>
        <Text fw={700}>Slider</Text>
      </Center>
    </Accordion.Control>
    <Accordion.Panel>
      Content
    </Accordion.Panel>
  </Accordion.Item>
  );
};

export default HomeSlider;
